INSERT INTO `product` VALUES (13,1,'2023-10-01 13:33:07.105670',1,NULL,8,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/d1.png','나긋한 톤, 신뢰감 있는 톤, 잔잔한 톤','영리 녹음 *광고,내레이션,게임,애니  등 *A4/12포인트/반 장 기준 *특이사항에 맞춰 조정/ 협의 후 진행'),(13,1,'2023-10-02 13:37:21.798952',2,NULL,9,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/d2.png','한 번 들을면 잊을 수 없는 목소리, 귀에 쏙 박히는 목소리','영리 녹음 *광고,내레이션,게임,애니  등 *A4/12포인트/반 장 기준 *특이사항에 맞춰 조정/ 협의 후 진행'),(12,1,'2023-10-01 13:44:02.234884',3,NULL,10,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/2.png','내레이션, SPOT 원하시는 느낌으로 녹음해 드립니다.','기업, 제품, 사업홍보 등 각종녹음 상업적이거나 대외적으로 이용하는 녹음 (12pt 기본여백 A4 1장당 8만원부터)'),(14,1,'2023-10-03 13:46:41.981931',4,NULL,11,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/5.png','밝고 명랑한 여성의 목소리입니다 체험해보세요!','밝은 분위기의 영상에 잘 어울리는 내레이션, 발랄한 역할의 npc에 잘 어울리는 목소리 입니다!'),(11,1,'2023-10-03 13:53:33.452907',5,NULL,12,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/d3.png','남자성우 한영 내레이션 더빙, 섬세하고 믿음가는 목소리','상업용 녹음 (가격 협의)<A4 용지 한장 당>폰트크기 12pt 이상 / 문단 구분 필수 / 스팟, 나레이션, 연기, 더빙 포함'),(13,1,'2023-10-02 14:02:07.657563',6,NULL,13,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/d4.png','듣기 좋은 목소리로 신속 정확하게 녹음해드립니다.','기본 분량 A4 반 장 이내  (공백 포함)'),(13,1,'2023-10-03 14:07:00.792876',7,NULL,14,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/d5.png','당일 녹음, 대본으로 무료 샘플 먼저 듣고 결정해보세요','광고, 홍보, 다큐멘터리, 영상 더빙, ARS 등 영리 목적 녹음: A4 용지 12pt 기준 1장'),(14,1,'2023-10-03 14:15:56.867478',8,NULL,16,'https://taw-s3-bucket2.s3.ap-northeast-2.amazonaws.com/images/d6.png','여자 성우 망둥어 청량한 음성을 선물해 드립니다','A4용지 반 장 기준 유튜브, 바이럴, 제품 홍보, 사내 영상, ARS, 안내 멘트 등 간단한 작업'),(11,1,'2023-10-05 14:57:30.207705',9,NULL,3,'https://api.dicebear.com/7.x/adventurer/svg?flip=true&eyebrows=variant06&eyes=variant18&hair=short16&mouth=variant21&skinColor=f2d3b1&hairColor=ab2a18','분좋은 목소리로 내레이션 광고 캐릭터 ARS 녹음해 드립니다','3분 이내 음성 녹음 <상업적 녹음> 나레이션/광고/홍보/캐릭터/더빙 등 (다량 작업 필요시 협의 가능) A4용지 12P 한장'),(12,1,'2023-10-05 15:30:05.420883',11,NULL,4,'https://api.dicebear.com/7.x/adventurer/svg?flip=true&eyebrows=variant08&eyes=variant17&hair=short05&mouth=variant26&skinColor=f2d3b1&hairColor=afafaf','목소리와 컨텐츠를 잇다, 동엽입니다.','유튜브/ 스팟/ 안내맨트/ 기업홍보/ 바이럴 (12pt, A4 500자 기준) *결제 전 상담 필수'),(12,1,'2023-10-05 15:43:56.993072',12,NULL,7,'https://api.dicebear.com/7.x/adventurer/svg?flip=true&eyebrows=variant03&eyes=variant01&hair=short02&mouth=variant24&skinColor=9e5622&hairColor=562306','어떤 녹음이든/경력2개월/전문녹음실','상업/비상업 모두 내레이션, 광고, 유튜브, 게임, 애니, 더빙, 캐릭터, 오디오북, 연기, ARS, 로고송'),(15,1,'2023-10-05 15:54:21.842293',13,NULL,5,'https://api.dicebear.com/7.x/adventurer/svg?flip=true&eyebrows=variant11&eyes=variant04&hair=short07&mouth=variant26&skinColor=f2d3b1&hairColor=b9a05f','목소리톤 광고, 내레이션, 스팟, 게임, 더빙','공백 제외 501자~ 천자 이하 글자 개당(한 자당) 15'),(15,1,'2023-10-05 16:00:44.140250',14,NULL,6,'https://api.dicebear.com/7.x/adventurer/svg?flip=true&eyebrows=variant01&eyes=variant05&hair=long09&mouth=variant23&skinColor=f2d3b1&hairColor=b9a05f','저음부터 고음까지 마법같은 목소리로 녹음 도와드립니다','일반 녹음일반 개인 녹음 (단체가 아니라 개인이 진행하는 작업)');
